                addButtonText={'Add Staff Member'}
                openCloseInfo={open}
                handleOpenClose={handleOpenClose}
                body={<CreateStaff handleClose={handleOpenClose}/>}
            >
                <StaffTable/>
            </TableWrapper>

            {/*)*/}
            {/*: (<OfficesInfo info={officeById}/>)*/}
        </>
    );
}
